CREATE DATABASE NBA_Database;
USE NBA_Database;

-- Table: Team
CREATE TABLE Team (
    TeamID INT PRIMARY KEY,
    Team VARCHAR(3)
);



-- Table: Season_Year
CREATE TABLE Season_Year (
    Year VARCHAR(7),
    Season_Start_Year INT,
    Season_Type VARCHAR(15)
);
CREATE INDEX idx_season_year ON Season_Year(Year);



-- Table: Regular_Season_Player_Stats
CREATE TABLE Regular_Season_Player_Stats (
    Year VARCHAR(7),
    SeasonStartYear INT,
    SeasonType VARCHAR(15),
    PlayerID INT PRIMARY KEY,
    Player VARCHAR(50),
    TeamID INT,
    GamesPlayed INT,
    MinutesPlayed INT,
    FGMade INT,
    FGAttempts INT,
    FGPercent DECIMAL(5, 3),
    ThreePtFGMade INT,
    ThreePtFGAttempts INT,
    ThreePtFGPercent DECIMAL(5, 3),
    FTMade INT,
    FTAttempts INT,
    FTPercent DECIMAL(5, 3),
    OffensiveRebounds INT,
    DefensiveRebounds INT,
    TotalRebounds INT,
    Assists INT,
    Steals INT,
    Blocks INT,
    Turnovers INT,
    PersonalFouls INT,
    PointsScored INT,
    Efficiency DECIMAL(6, 2),
    AST_TOV DECIMAL(4, 2),
    STL_TOV DECIMAL(4, 2),
    FOREIGN KEY (Year) REFERENCES Season_Year(Year),
    FOREIGN KEY (TeamID) REFERENCES Team(TeamID)
);



-- Table: Playoffs_Player_Stats
CREATE TABLE Playoffs_Player_Stats (
    Year VARCHAR(7),
    SeasonStartYear INT,
    SeasonType VARCHAR(15),
    PlayerID INT PRIMARY KEY,
    Player VARCHAR(50),
    TeamID INT,
    GamesPlayed INT,
    MinutesPlayed INT,
    FGMade INT,
    FGAttempts INT,
    FGPercent DECIMAL(5, 3),
    ThreePtFGMade INT,
    ThreePtFGAttempts INT,
    ThreePtFGPercent DECIMAL(5, 3),
    FTMade INT,
    FTAttempts INT,
    FTPercent DECIMAL(5, 3),
    OffensiveRebounds INT,
    DefensiveRebounds INT,
    TotalRebounds INT,
    Assists INT,
    Steals INT,
    Blocks INT,
    Turnovers INT,
    PersonalFouls INT,
    PointsScored INT,
    Efficiency DECIMAL(6, 2),
    AST_TOV DECIMAL(4, 2),
    STL_TOV DECIMAL(4, 2),
    FOREIGN KEY (Year) REFERENCES Season_Year(Year),
    FOREIGN KEY (TeamID) REFERENCES Team(TeamID)
);



-- Table: All_Star_Players
CREATE TABLE All_Star_Players (
    PlayerID INT PRIMARY KEY,
    Player VARCHAR(255),
    All_Star_Team VARCHAR(50),
    League VARCHAR(50),
    Season VARCHAR(7),
    Replaced BOOLEAN,
    FOREIGN KEY (PlayerID) REFERENCES Regular_Season_Player_Stats(PlayerID)
);



-- Data Cleaning
-- Identify and count missing values in the Regular_Season_Player_Stats table for the TeamID column.
SELECT COUNT(*) AS MissingCount
FROM Regular_Season_Player_Stats
WHERE TeamID IS NULL;

-- Replace missing values in the Regular_Season_Player_Stats table for the TeamID column with a default value (assuming there is a default team ID, e.g., 0).
UPDATE Regular_Season_Player_Stats
SET TeamID = 0
WHERE TeamID IS NULL;

-- Identify and count duplicate player names in the Regular_Season_Player_Stats table.
SELECT Player, COUNT(*) AS DuplicateCount
FROM Regular_Season_Player_Stats
GROUP BY Player
HAVING COUNT(*) > 1;

-- Remove duplicate rows based on the Player column in the Regular_Season_Player_Stats table.
DELETE t1
FROM Regular_Season_Player_Stats t1
INNER JOIN Regular_Season_Player_Stats t2
ON t1.PlayerID > t2.PlayerID AND t1.Player = t2.Player
WHERE t1.PlayerID > t2.PlayerID;

-- Convert the MinutesPlayed column in the Regular_Season_Player_Stats table to a different data type (assuming it's stored as an integer, and you want to convert it to decimal).
ALTER TABLE Regular_Season_Player_Stats
MODIFY COLUMN MinutesPlayed DECIMAL(10, 2);

-- Identify and remove outliers in the PointsScored column of the Regular_Season_Player_Stats table using percentiles.
SELECT Player, PointsScored
FROM Regular_Season_Player_Stats
WHERE PointsScored < (
  SELECT PointsScored
  FROM Regular_Season_Player_Stats
  ORDER BY PointsScored
  LIMIT 1
)
OR PointsScored > (
  SELECT PointsScored
  FROM Regular_Season_Player_Stats
  ORDER BY PointsScored DESC
  LIMIT 1
)
LIMIT 0, 1000;

-- Convert player names in the All_Star_Players table to lowercase for consistency.
UPDATE All_Star_Players
SET Player = LOWER(Player);

-- Trim leading and trailing spaces from the Team column in the Team table.
UPDATE Team
SET Team = TRIM(Team);


